  mutations: {
    setLastZIndex(state, data) {
      state.lastZIndex = data;
    },
    setStartPositoin(state, data) {
      state.startPosition[data.pageName] = data.offset;
      console.log(state);
    },
    selectNav(state, data) {
      if (state.selectedNavs.includes(data)) {
        state.selectedNavs = state.selectedNavs.filter(nav => nav !== data);
        return;
      }
      state.selectedNavs.push(data);
    },
    setLogList(state, data) {
      state.logList = data;
    },
    addLogs(state, data) {
      state.logList = [...state.logList, ...data];
    },
    pushLog(state, data) {
      state.logList.push(data);
    },
    setLogConfigs(state, data) {
      state.titles = data;
    },
    setCommands(state, data) {
      state.commandsConfig = data;
